{
  "translationLines": [
    {
      "lineNumber": 1,
      "originalJapaneseLine": "通りがかる人のチェックに入った。",
      "translatedEnglishLine": "Started checking the people passing by."
    },
    {
      "lineNumber": 2,
      "originalJapaneseLine": "「ふ〜〜〜む……」",
      "translatedEnglishLine": "\"Hmmmmm...\""
    },
    {
      "lineNumber": 3,
      "originalJapaneseLine": "「顔はいいけど、",
      "translatedEnglishLine": "\"Good face, but..."
    },
    {
      "lineNumber": 4,
      "originalJapaneseLine": "　ちょっち趣味じゃないかな〜」",
      "translatedEnglishLine": "Not really my type~\""
    },
    {
      "lineNumber": 5,
      "originalJapaneseLine": "「童貞はめんどいから嫌い」",
      "translatedEnglishLine": "\"I hate virgins because they're troublesome.\""
    },
    {
      "lineNumber": 6,
      "originalJapaneseLine": "「……へ？」",
      "translatedEnglishLine": "\"...Huh?\""
    },
    {
      "lineNumber": 7,
      "originalJapaneseLine": "「うーん、小便臭いのはパス」",
      "translatedEnglishLine": "\"Hmm, I’ll pass if he smells like urine.\""
    },
    {
      "lineNumber": 8,
      "originalJapaneseLine": "「しょ……",
      "translatedEnglishLine": "\"Sho...\""
    },
    {
      "lineNumber": 9,
      "originalJapaneseLine": "　なんですか？」",
      "translatedEnglishLine": "What's that?\""
    },
    {
      "lineNumber": 10,
      "originalJapaneseLine": "「顔がいいのは分かるけど……",
      "translatedEnglishLine": "\"I get that he has a nice face, but..."
    },
    {
      "lineNumber": 11,
      "originalJapaneseLine": "　モロミちゃんの好みじゃないよね」",
      "translatedEnglishLine": "He’s not Moromi-chan’s type, right?\""
    },
    {
      "lineNumber": 12,
      "originalJapaneseLine": "「歯の浮くようなこと言われたら、",
      "translatedEnglishLine": "\"If someone says something corny like that,"
    },
    {
      "lineNumber": 13,
      "originalJapaneseLine": "　思わず殴っちゃいそう……」",
      "translatedEnglishLine": "I’d probably end up wanting to punch them...\""
    },
    {
      "lineNumber": 14,
      "originalJapaneseLine": "「……後が面倒臭そうだしなぁ」",
      "translatedEnglishLine": "\"...And dealing with the aftermath seems like a pain.\""
    },
    {
      "lineNumber": 15,
      "originalJapaneseLine": "「あら、モロミさん？",
      "translatedEnglishLine": "\"Oh, Moromi-san?"
    },
    {
      "lineNumber": 16,
      "originalJapaneseLine": "　こんなところで何をしてるんです？」",
      "translatedEnglishLine": "What are you doing in a place like this?\""
    },
    {
      "lineNumber": 17,
      "originalJapaneseLine": "「あははー、なんでもないなーい。",
      "translatedEnglishLine": "\"Ahaha, it’s nothing at all."
    },
    {
      "lineNumber": 18,
      "originalJapaneseLine": "　失礼しまーす☆」",
      "translatedEnglishLine": "Excuse me~☆\""
    },
    {
      "lineNumber": 19,
      "originalJapaneseLine": "「？」",
      "translatedEnglishLine": "\"?\""
    },
    {
      "lineNumber": 20,
      "originalJapaneseLine": "「……一瞬、かなりグッと来た」",
      "translatedEnglishLine": "\"...For a moment, I felt quite drawn."
    },
    {
      "lineNumber": 21,
      "originalJapaneseLine": "「来たは来たけど……",
      "translatedEnglishLine": "\"I did feel drawn, but..."
    },
    {
      "lineNumber": 22,
      "originalJapaneseLine": "　あれ、見た目に反して芯は強いタイプな気がする」",
      "translatedEnglishLine": "I get the feeling he's the type with a strong core, despite appearances.\""
    },
    {
      "lineNumber": 23,
      "originalJapaneseLine": "「モロミちゃん、",
      "translatedEnglishLine": "\"Moromi-chan,"
    },
    {
      "lineNumber": 24,
      "originalJapaneseLine": "　最後には折れてくれる子が好きー」",
      "translatedEnglishLine": "likes girls who eventually give in.\""
    },
    {
      "lineNumber": 25,
      "originalJapaneseLine": "「悪くない……悪くない、けど……",
      "translatedEnglishLine": "\"Not bad... not bad, but..."
    },
    {
      "lineNumber": 26,
      "originalJapaneseLine": "　うーん、もう一声……」",
      "translatedEnglishLine": "Hmm, could be just a bit more...\""
    },
    {
      "lineNumber": 27,
      "originalJapaneseLine": "「なんだい？",
      "translatedEnglishLine": "\"What’s the matter?"
    },
    {
      "lineNumber": 28,
      "originalJapaneseLine": "　人のことエロ親父みたいな目でじろじろ見て……」",
      "translatedEnglishLine": "Why are you staring at me like a pervy old man...?\""
    },
    {
      "lineNumber": 29,
      "originalJapaneseLine": "「おや、これはメガデス殿。ﾇﾇﾇ」",
      "translatedEnglishLine": "\"Oh, this is Lord Megadeth. Nunu-nu.\""
    },
    {
      "lineNumber": 30,
      "originalJapaneseLine": "「お前らが来るとややこしいだろうが。",
      "translatedEnglishLine": "\"It gets complicated when you guys show up."
    },
    {
      "lineNumber": 31,
      "originalJapaneseLine": "　名前的に。絡むな。失せろ」",
      "translatedEnglishLine": "By name alone. Don’t get involved. Scram.\""
    },
    {
      "lineNumber": 32,
      "originalJapaneseLine": "「ぐっすん……ﾇﾇﾇ」",
      "translatedEnglishLine": "\"Sniff... Nunu-nu.\""
    },
    {
      "lineNumber": 33,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 34,
      "originalJapaneseLine": "「ないわー」",
      "translatedEnglishLine": "\"No way—\""
    },
    {
      "lineNumber": 35,
      "originalJapaneseLine": "「妾を今、馬鹿にせんかったかー！？」",
      "translatedEnglishLine": "\"Did you just make fun of me!?"
    },
    {
      "lineNumber": 36,
      "originalJapaneseLine": "「ぐうぐう……」",
      "translatedEnglishLine": "\"Gugu...\" (sleeping/snoring sound)"
    },
    {
      "lineNumber": 37,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 38,
      "originalJapaneseLine": "「はぷっ……」",
      "translatedEnglishLine": "\"Hap...\""
    },
    {
      "lineNumber": 39,
      "originalJapaneseLine": "なんとなくメガデスは、",
      "translatedEnglishLine": "For some reason, Megadeth"
    },
    {
      "lineNumber": 40,
      "originalJapaneseLine": "セスナにキス＆胸を揉んでみた。",
      "translatedEnglishLine": "tried kissing and groping Sesna's chest."
    },
    {
      "lineNumber": 41,
      "originalJapaneseLine": "「…………んっ、もが」",
      "translatedEnglishLine": "\"...Ngh, moga.\""
    },
    {
      "lineNumber": 42,
      "originalJapaneseLine": "「あ、はよー」",
      "translatedEnglishLine": "\"Ah, good morning.\""
    },
    {
      "lineNumber": 43,
      "originalJapaneseLine": "「…………どったの？」",
      "translatedEnglishLine": "\"...What’s wrong?\""
    },
    {
      "lineNumber": 44,
      "originalJapaneseLine": "「他に言うことないんかい」",
      "translatedEnglishLine": "\"Don’t you have anything else to say?\""
    },
    {
      "lineNumber": 45,
      "originalJapaneseLine": "「……モロミちゃんの……することだし」",
      "translatedEnglishLine": "\"...It's Moromi-chan's... thing to do after all.\""
    },
    {
      "lineNumber": 46,
      "originalJapaneseLine": "「慣れた……よね」",
      "translatedEnglishLine": "\"You’ve gotten used to it... right?\""
    },
    {
      "lineNumber": 47,
      "originalJapaneseLine": "「私のことよく理解してくれてありがとー。",
      "translatedEnglishLine": "\"Thanks for understanding me so well."
    },
    {
      "lineNumber": 48,
      "originalJapaneseLine": "　ほれ、ふらふら歩いてっと危ないから",
      "translatedEnglishLine": "Here, you better not wander around unsteadily, it’s dangerous."
    },
    {
      "lineNumber": 49,
      "originalJapaneseLine": "　セスナは部屋に戻って寝とけー」",
      "translatedEnglishLine": "Sesna, go back to your room and get some sleep.\""
    },
    {
      "lineNumber": 50,
      "originalJapaneseLine": "「うぃ……",
      "translatedEnglishLine": "\"Yeah...\""
    },
    {
      "lineNumber": 51,
      "originalJapaneseLine": "　そーする……」",
      "translatedEnglishLine": "I’ll do that...\""
    },
    {
      "lineNumber": 52,
      "originalJapaneseLine": "「おっ……おおっ……」",
      "translatedEnglishLine": "\"Oh... ohh...\""
    },
    {
      "lineNumber": 53,
      "originalJapaneseLine": "「……ぐう」",
      "translatedEnglishLine": "\"...Guu.\" (snoring sound)"
    },
    {
      "lineNumber": 54,
      "originalJapaneseLine": "「はーっ、こんなに人がいる城で、",
      "translatedEnglishLine": "\"Haaah, in a castle with so many people,"
    },
    {
      "lineNumber": 55,
      "originalJapaneseLine": "　バシッとはまる子が一人もいないとは、",
      "translatedEnglishLine": "not a single girl just perfectly fits,"
    },
    {
      "lineNumber": 56,
      "originalJapaneseLine": "　今日はアンラッキーデーかなー」",
      "translatedEnglishLine": "guess today’s an unlucky day.\""
    },
    {
      "lineNumber": 57,
      "originalJapaneseLine": "「普段は強がってるけど、",
      "translatedEnglishLine": "\"Usually they act tough, but"
    },
    {
      "lineNumber": 58,
      "originalJapaneseLine": "　きゃいんきゃいんって",
      "translatedEnglishLine": "are there any girls who might cry, crying like 'kyain-kyain'?"
    },
    {
      "lineNumber": 59,
      "originalJapaneseLine": "　泣いてくれそうな子はいないかなー」",
      "translatedEnglishLine": "\"I wonder if there’s a girl who’d cry like that...\""
    },
    {
      "lineNumber": 60,
      "originalJapaneseLine": "「おっ……？」",
      "translatedEnglishLine": "\"Oh... ?\""
    }
  ]
}

